(146, 14, 'wsg_introducao_titulo', '<h2><span style=\"color: #58c00d\">EFEITO BARIÁTRICA NATURAL</span> EM CÁPSULAS</h2>'),
(147, 14, 'wsg_introducao_texto', 'Ao total foram 8 anos de pesquisa e estudos para encontrar a tecnologia e a medida certa para desenvolver Lift Detox Caps.\r\n\r\nPensado para quem deseja emagrecer de maneira definitiva e livre do efeito sanfona, Lift Detox Caps já conquistou o mundo e foi aprovado em mais de 17 países como a verdadeira fórmula para emagrecer com saúde e sem sofrimento.\r\n\r\nLift Detox Caps funciona como uma cirurgia de emagrecimento. <strong>A combinação exclusiva dentro das cápsulas formam uma espécie de gel que proporciona uma poderosa ação inibidora de apetite, permitindo o emagrecimento rápido e saudável.</strong>\r\n\r\nSe você deseja;'),
(148, 14, 'wsg_introducao_checklist', 'a:4:{i:0;s:38:\"Emagrecer da maneira rápida e natural\";i:1;s:54:\"Com ativos 100% naturais e livre de efeitos colaterais\";i:2;s:41:\"Finalmente usar as roupas que sempre quis\";i:3;s:39:\"Reconquistar sua autoestima e qualidade\";}'),
