(157, 14, 'wsg_pontos_chave_desc', '<strong>Lift Detox Caps</strong> Com sua fórmula avançada, Lift Detox Caps queima gordura de forma acelerada, proporcionando um emagrecimento rápido e definitivo em poucas semanas.'),
(158, 14, 'pontos_chave_items', 'a:4:{i:0;a:4:{s:29:\"wsg_pontos_chave_items_img_id\";i:65;s:26:\"wsg_pontos_chave_items_img\";s:66:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/bn1.png\";s:29:\"wsg_pontos_chave_items_titulo\";s:21:\"ACELERA O METABOLISMO\";s:28:\"wsg_pontos_chave_items_texto\";s:155:\"O metabolismo acelerado faz com que a pessoa queime as calorias mais rapidamente, concentrando menos gorduras, de forma que fica mais difícil ganhar peso.\";}i:1;a:4:{s:29:\"wsg_pontos_chave_items_img_id\";i:66;s:26:\"wsg_pontos_chave_items_img\";s:66:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/bn2.png\";s:29:\"wsg_pontos_chave_items_titulo\";s:17:\"DIMINUI O APETITE\";s:28:\"wsg_pontos_chave_items_texto\";s:118:\"Os ativos presentes em seus compostos diminuem o apetite e reduzem a absorção de açúcares e gorduras no organismo.\";}i:2;a:4:{s:29:\"wsg_pontos_chave_items_img_id\";i:67;s:26:\"wsg_pontos_chave_items_img\";s:66:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/bn3.png\";s:29:\"wsg_pontos_chave_items_titulo\";s:18:\"REGULA O INTESTINO\";s:28:\"wsg_pontos_chave_items_texto\";s:149:\"Por ser composto por diversas fibras inteligentes, seu intestino começará a trabalhar de forma correta. Ajuda quem sofre com intestino preguiçoso.\";}i:3;a:4:{s:29:\"wsg_pontos_chave_items_img_id\";i:68;s:26:\"wsg_pontos_chave_items_img\";s:66:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/bn4.png\";s:29:\"wsg_pontos_chave_items_titulo\";s:22:\"EFEITO BARRIGA CHAPADA\";s:28:\"wsg_pontos_chave_items_texto\";s:99:\"Por acelerar o metabolismo e queimar a gordura localizada, reduz drasticamente a gordura abdominal.\";}}'),
(159, 14, 'wsg_componentes_show', 'on'),
(160, 14, 'wsg_componentes_titulo', '<h2>CONHEÇA O SEGREDO DA <span style=\"color: #58c00d\">FÓRMULA DE LIFT DETOX CAPS</span></h2>'),
(161, 14, 'componentes_items', 'a:6:{i:0;a:4:{s:28:\"wsg_componentes_items_img_id\";i:22;s:25:\"wsg_componentes_items_img\";s:65:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/f1.png\";s:28:\"wsg_componentes_items_titulo\";s:9:\"SPIRULINA\";s:27:\"wsg_componentes_items_texto\";s:169:\"Fonte de energia, vitamina e minerais a spirulina auxilia no fortalecimento do sistema imunológico, controla a pressão e o colesterol e melhora a performance muscular.\";}i:1;a:4:{s:28:\"wsg_componentes_items_img_id\";i:23;s:25:\"wsg_componentes_items_img\";s:65:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/f2.png\";s:28:\"wsg_componentes_items_titulo\";s:10:\"VITAMINA E\";s:27:\"wsg_componentes_items_texto\";s:165:\"Efeito antioxidante poderoso a vitamina E é um dos segredos para cuidar do colesterol e gordura do fígado já que a mesma é responsável por eliminar as gorduras.\";}i:2;a:4:{s:28:\"wsg_componentes_items_img_id\";i:24;s:25:\"wsg_componentes_items_img\";s:65:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/f3.png\";s:28:\"wsg_componentes_items_titulo\";s:8:\"GUARANÁ\";s:27:\"wsg_componentes_items_texto\";s:201:\"Rico em energia e extraído diretamente da Amazônia ele auxilia o organismo a expulsar a gordura e age como um combustível para o corpo, fornecendo muito mais energia e disposição para o dia-a-dia.\";}i:3;a:4:{s:28:\"wsg_componentes_items_img_id\";i:25;s:25:\"wsg_componentes_items_img\";s:65:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/f4.png\";s:28:\"wsg_componentes_items_titulo\";s:5:\"CROMO\";s:27:\"wsg_componentes_items_texto\";s:107:\"Age diretamente como um poderoso inibidor de apetite, trazendo saciedade e rápidos resultados na balança.\";}i:4;a:4:{s:28:\"wsg_componentes_items_img_id\";i:26;s:25:\"wsg_componentes_items_img\";s:65:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/f5.png\";s:28:\"wsg_componentes_items_titulo\";s:9:\"QUITOSANA\";s:27:\"wsg_componentes_items_texto\";s:95:\"Remédio Natural responsável por eliminar a gordura do corpo e regular o trânsito intestinal.\";}i:5;a:4:{s:28:\"wsg_componentes_items_img_id\";i:27;s:25:\"wsg_componentes_items_img\";s:65:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/f6.png\";s:28:\"wsg_componentes_items_titulo\";s:8:\"PSYLLIUM\";s:27:\"wsg_componentes_items_texto\";s:113:\"Rico em fibra o psyllium auxilia na perda de peso, no controle do colesterol e na redução da pressão arterial.\";}}'),
