(172, 14, 'wsg_mais_informacoes_titulo', 'FIM DA GUERRA CONTRA BALANÇA'),
(173, 14, 'wsg_mais_informacoes_texto', 'Você sabia que para ter resultados surpreendentes e muito mais rápidos é necessário fazer o uso de 2 cápsulas por dia?\r\n\r\nSim, é verdade para conseguir resultados incríveis com Lift Detox Caps basta tomar as cápsulas 40 min antes das principais refeições.\r\n\r\n<strong>Com uma fórmula altamente concentrada e ativos rigorosamente selecionados Lift Detox Caps auxilia na jornada do corpo ideal.</strong>'),
