(177, 14, 'demonstracao_items', 'a:2:{i:0;a:3:{s:29:\"wsg_demonstracao_items_img_id\";i:62;s:26:\"wsg_demonstracao_items_img\";s:69:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/anvisa.png\";s:28:\"wsg_demonstracao_items_texto\";s:200:\"<strong>Lift Detox Caps é liberado e aprovado pela Anvisa</strong> nos termos da RDC 240 de 26/07/2018, sendo dispensado de registro, pois é avaliado como 100% Seguro para o consumo da população.\";}i:1;a:3:{s:29:\"wsg_demonstracao_items_img_id\";i:45;s:26:\"wsg_demonstracao_items_img\";s:70:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/natural.png\";s:28:\"wsg_demonstracao_items_texto\";s:188:\"Todos os Componentes da Fórmula <strong>Lift Detox Caps são 100% Naturais</strong> sendo liberado para o uso sem preocupações como irritação e alergias, Garantindo mais segurança.\";}}'),
(178, 14, 'wsg_demonstracao_destaque_img_id', '57'),
(179, 14, 'wsg_demonstracao_destaque_img', 'http://localhost/infoproduto-02/wp-content/uploads/2022/02/simulacao.jpg'),
(180, 14, 'wsg_demonstracao_titulo', '<h2>VEJA COMO O <span style=\"color: #58c00d\">LIFT DETOX CAPS FUNCIONA</span></h2>'),
(181, 14, 'wsg_demonstracao_texto', 'A fórmula de Lift Detox Caps possui um composto natural capaz de induzir a queima acelerada de gordura do corpo, levando a perda de até 2kg de pura gordura profunda do corpo, principalmente da barriga, braços e pernas.\r\n\r\nA descoberta americana em torno do Lift Detox Caps, levou a comprovação de que as moléculas do composto, imitiam os mesmos \"sinais\" que são emitidos quando ingerimos uma refeição. Dessa forma, seu organismo acha que você está comendo e ativa o receptor, que inicia a quebra dos triglicérides de gordura, no entanto você não está ingerindo gordura, apenas a pílula.\r\n\r\nPor esse motivo, cientistas batizaram a fórmula como a \"Pílula da refeição imaginária\". A fórmula natural de Lift Detox Caps ativa os receptores sem criar nenhum efeito colateral no corpo, e eliminado camadas profundas de gordura abdominal e visceral.\r\n\r\nConquistar o corpo dos seus sonhos, sem \"gorduras chatas\" agora é possível, com a aprovação de Lift Detox Caps pela Anvisa. Sacia a fome, enquanto elimina até 2kg de gordura por semana.'),
(182, 14, 'wsg_garantia_titulo', '<h2>É A SUA PRIMEIRA <span style=\"color: #58c00d\">COMPRA NA INTERNET?</span></h2>'),
(183, 14, 'wsg_garantia_titulo_after', 'Não se preocupe, site 100% seguro, empresa confiável e entrega garantida!'),
(184, 14, 'garantia_items', 'a:4:{i:0;a:3:{s:25:\"wsg_garantia_items_img_id\";i:56;s:22:\"wsg_garantia_items_img\";s:69:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/sigilo.png\";s:24:\"wsg_garantia_items_texto\";s:102:\"Seus potes serão enviados com total sigilo e segurança, desde a embalagem do produto até a entrega.\";}i:1;a:3:{s:25:\"wsg_garantia_items_img_id\";i:15;s:22:\"wsg_garantia_items_img\";s:69:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/compra.png\";s:24:\"wsg_garantia_items_texto\";s:90:\"Trabalhamos com a Braip, plataforma que utiliza os mais avançados recursos de segurança.\";}i:2;a:3:{s:25:\"wsg_garantia_items_img_id\";i:47;s:22:\"wsg_garantia_items_img\";s:70:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/parcela.png\";s:24:\"wsg_garantia_items_texto\";s:103:\"Facilitamos para sua compra, você poderá parcelar até 12x no cartão de credito de sua preferência.\";}i:3;a:3:{s:25:\"wsg_garantia_items_img_id\";i:29;s:22:\"wsg_garantia_items_img\";s:69:\"http://localhost/infoproduto-02/wp-content/uploads/2022/02/freteg.png\";s:24:\"wsg_garantia_items_texto\";s:120:\"Aproveite nossa oferta e compre com frete grátís e conte com toda discrição pois seus dados pessoais estão seguros.\";}}'),
