(189, 14, 'wsg_faq_titulo', 'AINDA COM DÚVIDAS?'),
(190, 14, 'wsg_faq_subtitulo', 'Aqui estão as principais dúvidas sobre o Lift Detox Caps'),
(191, 14, 'faq_items_esq', 'a:4:{i:0;a:2:{s:26:\"wsg_faq_items_esq_pergunta\";s:36:\"QUAIS OS EFEITOS DO LIFT DETOX CAPS?\";s:26:\"wsg_faq_items_esq_resposta\";s:464:\"Possui benefícios para a melhora da saúde, colaborando na regulação do intestino, promovendo saciedade, controlando apetite, desintoxicando o corpo e consequentemente potencializando os resultados na busca de um corpo saudável e magro. possui uma ação emagrecedora, atuando na queima de gordura, desintoxicação do corpo, auxiliando na redução do inchaço do seu corpo, aumentando sua disposição e fazendo você emagrecer de forma rápida e definitiva.\";}i:1;a:2:{s:26:\"wsg_faq_items_esq_pergunta\";s:53:\"QUANTO TEMPO EU TEREI RESULTADOS COM LIFT DETOX CAPS?\";s:26:\"wsg_faq_items_esq_resposta\";s:131:\"Com benefícios para o seu corpo, saúde, energia e disposição. Resultados podem variar de acordo com o organismo de cada pessoa.\";}i:2;a:2:{s:26:\"wsg_faq_items_esq_pergunta\";s:39:\"O LIFT DETOX CAPS VAI FUNCIONAR EM MIM?\";s:26:\"wsg_faq_items_esq_resposta\";s:350:\"As substâncias ativas encontradas no Lift Detox Caps vão desintoxicar o seu corpo, eliminar as toxinas e estimular o seu metabolismo e organismo, proporcionando assim, o bem estar definitivo, a queima de gordura localizada e a restauração da saúde do corpo. Com Lift Detox Caps você já consegue ver diferença já nas primeiras semanas de uso.\";}i:3;a:2:{s:26:\"wsg_faq_items_esq_pergunta\";s:43:\"QUAL O PRAZO DA ENTREGA DO LIFT DETOX CAPS?\";s:26:\"wsg_faq_items_esq_resposta\";s:332:\"O prazo médio de entrega do Lift Detox Caps 7 a 15 dias úteis, finais de semana e feriado não é contabilizados. O envio é pelo Correios. FRETE GRÁTIS PARA TODO O BRASIL! O prazo passa a valer após a confirmação do seu pagamento pela administradora do seu cartão de crédito ou após a confirmação do pagamento do boleto.\";}}'),
(192, 14, 'faq_items_dir', 'a:4:{i:0;a:2:{s:26:\"wsg_faq_items_dir_pergunta\";s:33:\"COMO DEVO USAR O LIFT DETOX CAPS?\";s:26:\"wsg_faq_items_dir_resposta\";s:76:\"Indicado tomar Lift Detox Caps2(duas) vezes ao dia antes de cada refeição.\";}i:1;a:2:{s:26:\"wsg_faq_items_dir_pergunta\";s:17:\"O SITE É SEGURO?\";s:26:\"wsg_faq_items_dir_resposta\";s:82:\"Sim, trabalhamos com selo SSL de segurança, Ebit, selo google e Antivirus Norton.\";}i:2;a:2:{s:26:\"wsg_faq_items_dir_pergunta\";s:48:\"OS BENEFÍCIOS SÃO COMPROVADOS CIENTIFICAMENTE?\";s:26:\"wsg_faq_items_dir_resposta\";s:490:\"Sim. Os ingredientes que compõe o Lift Detox Caps possuem propriedades nutricionais como algas, vitaminas, minerais, fibras, aminoácidos, fitonutrientes e formulações detox que são essenciais para o perfeito funcionamento do organismo. Lift Detox Caps funciona e possui benefícios para a queima de gordura e melhora da saúde, colaborando na regulação do intestino, promovendo saciedade, desintoxicando o corpo e consequentemente gerando os resultados de um corpo saudável e magro.\";}i:3;a:2:{s:26:\"wsg_faq_items_dir_pergunta\";s:40:\"LIFT DETOX CAPS É APROVADO PELA ANVISA?\";s:26:\"wsg_faq_items_dir_resposta\";s:135:\"Por se tratar de um Suplemento alimentar, Lift Detox Caps é um produto dispensado da obrigatoriedade de registro conforme RDC 27/2010.\";}}'),
(193, 14, 'wsg_cta_footer_show', 'on'),
(194, 14, 'wsg_cta_footer_titulo', 'EMAGRECIMENTO COMPROVADO!'),
(195, 14, 'wsg_cta_footer_texto', '<h3>SE NÃO HOUVER RESULTADOS EM 30 DIAS VOCÊ PODE DEVOLVER!</h3>\r\nÉ sério! Você fica satisfeito, ou compramos o Lift Detox Caps de volta de você! Se por qualquer motivo achar que o Lift Detox Caps não ajudou , nós nos comprometemos em devolver a quantia paga pelo seu kit de potes de Lift Detox Caps FÓRMULA AVANÇADA. Temos certeza que Lift Detox Caps vai cumprir com o prometido, por isso nosso compromisso é uma garantia incondicionais de 30 DIAS. Saiba mais em Termos e condições\r\n\r\n<strong>Você terá até 30 dias após a compra para solicitar a devolução.</strong>'),
